import React from 'react'

const Coin = ({name, image, symbol, }) => {
    return (
        <div className="coin-container">
            <div className="coin-row">
                <div className="coin">
                    <img src={image} alt='coin-logo' />
                </div>
            </div>
        </div>
    )
}

export default Coin
